import styled from "styled-components";

/** 표에 CSS를 적용한 styledComponent */

const Table = styled.table`
    border-collapse: collapse;
    border-top : 3px solid #168;
    font-size: 14px;
    text-align: center;
    margin: auto;
    width: 100%;

    th {
        color: #168;
        background: #f0f6f9;
        padding: 10px;
        border: 1px solid #ddd;
    }


`
export default Table
